import styled from 'styled-components';

export const ItemsContainer = styled.div`
  display: grid;
  grid-auto-flow: column;
  gap: 5px;
  align-items: center;

  h3 {
    margin: 0;
    color: white;
    margin-left: 80px;
  }
`;
